import { useNavigate } from "react-router-dom";
import { Dropdown, ButtonToolbar } from "rsuite";
import { BiDotsHorizontal } from "react-icons/bi";
import { BsReplyAll } from "react-icons/bs";
import { CgPoll } from "react-icons/cg";
export const LongMenuLeft = () => {
  const navigate = useNavigate();
  const SettingsIndexData = [
    {
      toptile: "Company Setup",
      cat1: [
        {
          link: "/hr/company_setup",
          inertitle: "Company Setup",
          text: "Add your company details here",
        },
        {
          link: "/hr/dashboard_setup",
          inertitle: "Dashboard Setup",
          text: "Customize your dashboard",
        },
      ],
    },
  ];
  const LongMenuLeftApp = () => {
    return (
      <>
        <Dropdown title={<BiDotsHorizontal />} activeKey="e-2">
          <Dropdown.Item
            className="chat_div_dropdown_inner"
            onClick={() => navigate("/")}
            eventKey="a"
          >
            reply
            <span>
              <BsReplyAll />
            </span>
          </Dropdown.Item>
          <Dropdown.Menu className="chat_div_dropdown_inner" title="More">
            <Dropdown.Item className="chat_div_dropdown_inner" eventKey="e-1">
              <span>
                <CgPoll />
              </span>
              Create Poll
            </Dropdown.Item>
          </Dropdown.Menu>
        </Dropdown>
      </>
    );
  };
  return (
    <div className="chat_div_dropdown">
      <ButtonToolbar>
        {LongMenuLeftData.map((val, i) => {
          return <LongMenuLeftApp key={i} {...val} arr={val} />;
        })}
      </ButtonToolbar>
    </div>
  );
};
